public class InnerTopicRuleActionFactory(Action<Humidifier.IoT.TopicRuleTypes.Action> factoryAction = null) : SubResourceFactory<Humidifier.IoT.TopicRuleTypes.Action>
{

    internal InnerTopicRuleS3ActionFactory S3Factory { get; set; }

    internal InnerTopicRuleCloudwatchAlarmActionFactory CloudwatchAlarmFactory { get; set; }

    internal InnerTopicRuleIotEventsActionFactory IotEventsFactory { get; set; }

    internal InnerTopicRuleFirehoseActionFactory FirehoseFactory { get; set; }

    internal InnerTopicRuleRepublishActionFactory RepublishFactory { get; set; }

    internal InnerTopicRuleKafkaActionFactory KafkaFactory { get; set; }

    internal InnerTopicRuleStepFunctionsActionFactory StepFunctionsFactory { get; set; }

    internal InnerTopicRuleDynamoDBActionFactory DynamoDBFactory { get; set; }

    internal InnerTopicRuleHttpActionFactory HttpFactory { get; set; }

    internal InnerTopicRuleOpenSearchActionFactory OpenSearchFactory { get; set; }

    internal InnerTopicRuleDynamoDBv2ActionFactory DynamoDBv2Factory { get; set; }

    internal InnerTopicRuleCloudwatchMetricActionFactory CloudwatchMetricFactory { get; set; }

    internal InnerTopicRuleIotSiteWiseActionFactory IotSiteWiseFactory { get; set; }

    internal InnerTopicRuleElasticsearchActionFactory ElasticsearchFactory { get; set; }

    internal InnerTopicRuleSqsActionFactory SqsFactory { get; set; }

    internal InnerTopicRuleKinesisActionFactory KinesisFactory { get; set; }

    internal InnerTopicRuleCloudwatchLogsActionFactory CloudwatchLogsFactory { get; set; }

    internal InnerTopicRuleTimestreamActionFactory TimestreamFactory { get; set; }

    internal InnerTopicRuleIotAnalyticsActionFactory IotAnalyticsFactory { get; set; }

    internal InnerTopicRuleSnsActionFactory SnsFactory { get; set; }

    internal InnerTopicRuleLambdaActionFactory LambdaFactory { get; set; }

    internal InnerTopicRuleLocationActionFactory LocationFactory { get; set; }

    protected override Humidifier.IoT.TopicRuleTypes.Action Create()
    {
        var actionResult = CreateAction();
        factoryAction?.Invoke(actionResult);

        return actionResult;
    }

    private Humidifier.IoT.TopicRuleTypes.Action CreateAction()
    {
        var actionResult = new Humidifier.IoT.TopicRuleTypes.Action();

        return actionResult;
    }
    public override void CreateChildren(Humidifier.IoT.TopicRuleTypes.Action result)
    {
        base.CreateChildren(result);

        result.S3 ??= S3Factory?.Build();
        result.CloudwatchAlarm ??= CloudwatchAlarmFactory?.Build();
        result.IotEvents ??= IotEventsFactory?.Build();
        result.Firehose ??= FirehoseFactory?.Build();
        result.Republish ??= RepublishFactory?.Build();
        result.Kafka ??= KafkaFactory?.Build();
        result.StepFunctions ??= StepFunctionsFactory?.Build();
        result.DynamoDB ??= DynamoDBFactory?.Build();
        result.Http ??= HttpFactory?.Build();
        result.OpenSearch ??= OpenSearchFactory?.Build();
        result.DynamoDBv2 ??= DynamoDBv2Factory?.Build();
        result.CloudwatchMetric ??= CloudwatchMetricFactory?.Build();
        result.IotSiteWise ??= IotSiteWiseFactory?.Build();
        result.Elasticsearch ??= ElasticsearchFactory?.Build();
        result.Sqs ??= SqsFactory?.Build();
        result.Kinesis ??= KinesisFactory?.Build();
        result.CloudwatchLogs ??= CloudwatchLogsFactory?.Build();
        result.Timestream ??= TimestreamFactory?.Build();
        result.IotAnalytics ??= IotAnalyticsFactory?.Build();
        result.Sns ??= SnsFactory?.Build();
        result.Lambda ??= LambdaFactory?.Build();
        result.Location ??= LocationFactory?.Build();
    }

} // End Of Class

